@-moz-document domain("codingnepalweb.com") {
/* Site Settings */

* {
	letter-spacing: 1px!important;
	text-decoration: none!important;
	transition: none!important;
}

.sf-menu>li>a
{
	text-transform: capitalize!important;
}

.enlighter-t-classic,
.td-post-source-tags a,
.td-ps-border .td-social-network .td-social-but-icon, .td-ps-border .td-social-network .td-social-but-text,
.td-social-handler,
.td-social-style8 .td_social_type .td-social-box,

:focus
{
	border: none!important;
	box-shadow: none!important;
	outline: none!important;
    text-shadow: none!important;
}

body .tdi_8 .td-module-container:hover .td-thumb-css {
    transform: none;
    -webkit-transform: none;
}

/* Fonts 
_____________________________________________________________________________________________________*/

.block-title,
.enlighter-t-classic .enlighter span,
.sf-menu>li>a
{
	font-size: 1.85rem!important;
}

.author-box-wrap .desc,
.tagdiv-type,
.td-excerpt,
.td_block_related_posts .td-module-title,
.td_module_6 .entry-title,
.td_module_mx4 .entry-title,

body
{
	font-size: 1.5rem!important;
}

.sf-menu ul .td-menu-item>a,
.td-social-network, .td-social-handler,
.td-post-source-tags a,
.td-module-meta-info
{
	font-size: 1.2rem!important;
}

.enlighter-t-classic .enlighter span
{
	line-height: 2.5rem!important;
}

.enlighter span,
.td-excerpt,
.td_block_related_posts .td-module-title,
.td_module_6 .entry-title,
.td_module_mx4 .entry-title
{
	line-height: 2.1rem!important;
}

/* Remove Items 
_____________________________________________________________________________________________________*/

.adsbygoogle,
.google-auto-placed
{
	left: -9999px!important;
	position: absolute!important;
	top: -9999px!important;
}

/* Left/Right/Top/Bottom 
_____________________________________________________________________________________________________*/

selector
{
    top: 10px!important;
}

/* Margins 
_____________________________________________________________________________________________________*/

.td-pb-span4,
.td-pb-span8
{
	margin: 1.2rem!important;
}

selector
{
	margin: 3px 6px!important;
}

/* Paddings 
_____________________________________________________________________________________________________*/

.td-pb-span4,
.td-pb-span8
{
	padding: 1.2rem!important;
}

selector
{
	padding: 13px 26px!important;
}


/* Heights 
_____________________________________________________________________________________________________*/

selector
{
	max-height: none!important;
}

selector
{
	height: auto!important;
}

/* Widths 
_____________________________________________________________________________________________________*/

selector
{
	max-width: none!important;
}

.td-pb-span4 .wpb_wrapper
{
	width: auto!important;
}

.td-container,
.tdc-row,
.tdc-row-composer
{
	width: 98%!important;
}

.td-pb-span8,
.td-pb-span4 {
    width: 70%;
}

.td-main-sidebar
{
	float: right!important;
	width: 28%!important;
}

}

